import React, { useEffect, useState } from "react";
import HeaderBar from "@components/header"
import { useHistory } from "react-router-dom";
import { saleHistory } from "./request"
import { orderStatus } from "./entity"
import "./style.scss"
import { Toast } from "antd-mobile";
import { mm_dd_hh_mm_ss2 } from "@utils/dataTime";
import { toFixed } from "@utils/numberUtils";
const Activity = () => {
  const [data, setData] = useState<any>([])

  const { goBack } = useHistory();
  useEffect(() => {
    saleHistoryHandle()
  }, [])
  const saleHistoryHandle = () => {
    Toast.loading('加载中...')
    saleHistory().then(data => {
      setData(data)
      Toast.hide()
    })
  }
  return (
    <div className="consignment-record-wrap">
      <HeaderBar goback={goBack} title={"代售记录"} />
      {
        data.length > 0 ? <ul className="consignments">
          {
            data.map((item: any) => {
              return (
                <li className="item" key={item.orderId}>
                  <div className="item-info">
                    <div className="item-top">
                      <span className="order-icon"></span>
                      <p className="order-i">
                        <span className="special">¥{toFixed(item.payAmount)}</span>
                        <span>赚:<i className="info-icon"></i>¥{toFixed(item.bonus)}</span>
                      </p>
                    </div>
                    <span className="success">
                        {/*  成功  掉单  */}
                        {item.orderStatus === 'SUCCESS' && !item.copyNewOrder ?'待确认':null}
                        {/*  成功  复制补单成功  */}
                        {item.orderStatus === 'SUCCESS' && item.copyNewOrder ?'复制补单成功':null}
                        {/*  已追回  */}
                        {item.orderStatus === 'CHASE_SUCCESS'  ?'复制补已追回单成功':null}
                        {/*  失败  */}
                        {item.orderStatus === 'NOT_RECEIVE_MONEY'  ?'失败':null}
                        {/*  重置确认  */}
                        {item.orderStatus === 'WAIT_USER_ACK' && item.resetOrder ?'重置确认':null}
                        {/*  掉单.待确认  */}
                        {item.orderStatus === 'WAIT_USER_ACK' && item.dropOrder ?'掉单.待确认':null}
                        {/*  复制补单.待确认  */}
                        {item.orderStatus === 'WAIT_USER_ACK' && item.copyNewOrder ?'复制补单.待确认':null}
                        {/*  等待会员确认  */}
                        {item.orderStatus === 'WAIT_USER_ACK' && item.resetOrder && item.dropOrder && item.copyNewOrder ?'等待会员确认':null}
                        {/*  确认超时  */}
                        {item.orderStatus === 'SUBMIT_TIMEOUT' ?'确认超时':null}
                        {/*  待审核未到款  */}
                        {item.orderStatus === 'WAIT_PLATFORM_CHECK_FOR_NOT_RECEIVE' ?'待审核未到款':null}
                      </span>
                  </div>
                  <p className="item-bank">
                    <span>银行卡号:{item.bankCardNo}</span>
                    <span>姓名:{item.payerName}</span>
                  </p>
                  <p className="item-order">
                    <span>订单编号:{item.orderId}</span>
                    <span style={{ flex: '1 1 30%', textAlign: 'end' }}>{mm_dd_hh_mm_ss2(item.payTime)}</span>
                  </p>
                </li>
              )
            })
          }
        </ul> : <div className="no-datas">暂无数据</div>
      }
    </div >
  )
}
export default Activity;
